                content: 'This is my comment',
                username: 'Tommy',
                date: '12-12-2018'
            },
            {
                content: 'This is another comment',
                username: 'Sammy',
                date: '12-17-2018'
            },
            {
                content: 'Here\'s a comment from me',
                username: 'Sally',
                date: '12-12-2018'
            },
        ]
        return (
            <div className='container'>
                <Post />
                <Post />
                <Post />
            </div>
        )
    }
}
